r($,"aPP","arm",()=>{var q="Unicyber",p="https://github.com/reitmas32/UNICyber"
return A.p7("![Image](https://raw.githubusercontent.com/reitmas32/UNICyber-BackEnd/main/logo-unicyber.png)\n## UNICyber, Sistema de Pr\xe9stamo de Equipos para Salas de UNICA\n\n## Descripci\xf3n\n\nEl Sistema de Pr\xe9stamo de Equipos para Salas de UNICA es una aplicaci\xf3n dise\xf1ada para administrar el pr\xe9stamo de equipos de computo. Este sistema proporciona un conjunto de operaciones que permiten la gesti\xf3n de cuentas de usuario, la creaci\xf3n y mantenimiento de aulas, el registro y seguimiento de alumnos, el control de pr\xe9stamos de equipos y la generaci\xf3n de estad\xedsticas.\n\n## Caracter\xedsticas\n\n- **Operaciones de Cuentas** \u2705\n  - Conexi\xf3n para Registro de Usuarios UNICA (SignUp) utilizando el sistema UNIAccounts.\n  - Inicio de Sesi\xf3n (SignIn) con UNIAccounts para autenticar a los usuarios.\n\n- **Operaciones de UI**\n  - Creaci\xf3n de Aulas para un Usuario.\n  - Eliminaci\xf3n de Aulas.\n  - Cambio de datos de una Aula (nombre).\n  - Actualizaci\xf3n de la posici\xf3n de una Aula.\n  - A\xf1adir una nueva Computadora/Impresora/Scanner a una Aula.\n  - Eliminar una Computadora de una Aula.\n  - Actualizaci\xf3n de la posici\xf3n de una Computadora.\n  - Cambiar datos de una Computadora (nombre/tipo).\n\n- **Operaciones de Alumnos**\n  - Crear un Alumno.\n  - Eliminar un Alumno.\n  - Actualizar informaci\xf3n de un Alumno.\n  - Obtener Datos de un Alumno.\n\n- **Operaciones de Pr\xe9stamo**\n  - Prestar una PC/Impresora/Scanner.\n  - Sancionar a un usuario y eliminar sanciones.\n  - Liberar un equipo prestado.\n\n- **Operaciones de Estado de PCs**\n  - Cambiar el Estado de una PC.\n  - Agregar mensajes informativos sobre una PC.\n\n- **Operaciones de Estad\xedsticas**\n  - Generar estad\xedsticas por Pos Sala/Usuario.\n  - Estad\xedsticas por Aula.\n  - Estad\xedsticas por A\xf1o y Mes.\n  - Estad\xedsticas por Alumno.\n  - Estad\xedsticas por Computadora.\n\n- **Operaciones de Mantenimiento**\n  - Apagar una PC.\n  - Obtener datos de una PC.\n  - Ejecutar programas o encuestas en una PC.\n\n## Instrucciones de Ejecuci\xf3n\n\nSigue los siguientes pasos para ejecutar el sistema:\n\n1. Clona el repositorio desde GitHub: \n###### git clone https://github.com/reitmas32/UNICyber.git\n\n2. Inicializar proyecto Flutter: \n###### flutter create .\n\n3. Ejecuta la aplicaci\xf3n utilizando el comando: \n###### flutter run -d [Device]\n\n## Compilaci\xf3n\n\nPara compilar el codigo y obtener un ejecutable: \n###### flutter build [web|linux|windows]\n\n## Contribuciones\n\n\xa1Agradecemos las contribuciones a este proyecto! Si deseas colaborar, sigue las directrices para contribuir al c\xf3digo y abre solicitudes de extracci\xf3n (Pull Requests). Tambi\xe9n puedes reportar problemas o sugerir mejoras a trav\xe9s de las issues en el repositorio de GitHub.\n\n## Contacto\n\nSi tienes preguntas o comentarios sobre el proyecto, no dudes en ponerte en contacto con el equipo de desarrollo a trav\xe9s de unihacks.mail@gmail.com.\n\n\xa1Gracias por tu inter\xe9s en nuestro proyecto! Esperamos que el Sistema de Pr\xe9stamo de Equipos para Salas de UNICA sea de gran utilidad y facilite la administraci\xf3n de los recursos tecnol\xf3gicos en la instituci\xf3n.\n\n\n","El Sistema de Pr\xe9stamo de Equipos para Salas de UNICA es una aplicaci\xf3n dise\xf1ada para administrar el pr\xe9stamo de equipos de computo. Este sistema proporciona un conjunto de operaciones que permiten la gesti\xf3n de cuentas de usuario, la creaci\xf3n y mantenimiento de aulas, el registro y seguimiento de alumnos, el control de pr\xe9stamos de equipos y la generaci\xf3n de estad\xedsticas.","https://raw.githubusercontent.com/reitmas32/UNICyber-BackEnd/main/logo-unicyber.png",A.nS(2023,7,28),A.a(["design","dev","Python","Flutter"],t.s),q,q,p,p)})
r($,"aPQ","arn",()=>{var q="UNIHacks"
return A.p7("## UNIHacks - Landingpage\n\n![Logo UNIHacks](https://raw.githubusercontent.com/reitmas32/home/main/assets/logo-unihacks.png)\n\nBienvenido a la p\xe1gina de inicio de UNIHacks. Somos una organizaci\xf3n sin fines de lucro dedicada al desarrollo de proyectos de c\xf3digo abierto, creados y mantenidos por estudiantes apasionados por la tecnolog\xeda de la Facultad de Ingenier\xeda de la Universidad Nacional Aut\xf3noma de M\xe9xico (UNAM).\n\n## Acerca de Nosotros\n\nEn UNIHacks, creemos en la colaboraci\xf3n, el aprendizaje y la innovaci\xf3n a trav\xe9s del c\xf3digo abierto. Nuestro objetivo es proporcionar un espacio donde los estudiantes de la UNAM puedan trabajar en proyectos tecnol\xf3gicos emocionantes, adquirir experiencia pr\xe1ctica y contribuir al mundo del software libre.\n\n## \xdanete a Nosotros\n\nSi eres estudiante de la Facultad de Ingenier\xeda de la UNAM y te apasiona la tecnolog\xeda y el c\xf3digo abierto, \xa1\xfanete a nosotros! Aqu\xed puedes aprender, colaborar y crear proyectos emocionantes con un grupo de compa\xf1eros entusiastas.\n\n## Contacto\n\nSi tienes alguna pregunta o est\xe1s interesado en colaborar con nosotros, no dudes en ponerte en contacto:\n\n- Correo Electr\xf3nico: unihacks.mail@gmail.com\n- Sitio Web: [unihacks.onrender.com](https://unihacks.onrender.com/)\n- Redes Sociales: [GitHub](https://github.com/UniHacksOrg)\n\n## Contribuci\xf3n\n\nSi deseas contribuir a nuestra p\xe1gina de inicio o a alguno de nuestros proyectos, \xa1estamos abiertos a colaboraciones! Solo tienes que hacer un fork del repositorio y crear una solicitud de extracci\xf3n con tus mejoras.\n\n## Licencia\n\nEste proyecto est\xe1 bajo la Licencia MIT. Consulta el archivo [LICENSE](./LICENSE) para obtener m\xe1s detalles.\n\n---\n\n\xa1Gracias por visitar la p\xe1gina de inicio de UNAM OpenSource Projects! Esperamos verte pronto en nuestros proyectos y eventos.\n\n**Equipo de UNAM OpenSource Projects**\n\n      ","Somos un equipo diverso de estudiantes unidos por la pasi\xf3n por la tecnolog\xeda y la innovaci\xf3n, colaborando para abordar desaf\xedos en nuestra comunidad universitaria.","https://raw.githubusercontent.com/reitmas32/home/main/assets/home_dark.png",A.nS(2023,9,3),A.a(["design","dev","flutter"],t.s),q,q,"https://unihacks.onrender.com","https://github.com/reitmas32/home")})
r($,"aQ_","arq",()=>{var q="YonestoUI"
return A.p7("# Tiendita App\n\nTiendita App es una aplicaci\xf3n multiplataforma desarrollada en Flutter que permite a los usuarios comprar productos de una tiendita de forma r\xe1pida y sencilla. Esta aplicaci\xf3n es ideal para peque\xf1as tiendas locales que desean tener una presencia en l\xednea y ofrecer a sus clientes una experiencia de compra conveniente.\n\n## Caracter\xedsticas\n\n- Exploraci\xf3n de productos: Los usuarios pueden navegar por una lista de productos disponibles en la tienda.\n- Detalles del producto: Obt\xe9n informaci\xf3n detallada sobre cada producto, incluyendo descripciones, precios y disponibilidad.\n- Carrito de compras: Los usuarios pueden agregar productos al carrito de compras y gestionar las cantidades.\n\n## Capturas de Pantalla\n\n![Vista Web](https://raw.githubusercontent.com/reitmas32/yonesto_ui/main/assets/ui_store.png)\n![Vista Movile](https://raw.githubusercontent.com/reitmas32/yonesto_ui/main/assets/movile.png)\n![Vista Movile Tema Claro](https://raw.githubusercontent.com/reitmas32/yonesto_ui/main/assets/movile_light.png)\n\n## Instalaci\xf3n\n\n1. Clona este repositorio:\n\n\n###### git clone 'https://github.com/reitmas32/yonesto_ui.git'\n\n2. Ejecuta la aplicacion Web\n\n\n###### flutter run -d chrome\n\n\n3. Compila la App Web\n\n\n###### flutter build web\n\n      ","Tiendita App es una aplicaci\xf3n multiplataforma desarrollada en Flutter que permite a los usuarios comprar productos de una tiendita de forma r\xe1pida y sencilla. Esta aplicaci\xf3n es ideal para peque\xf1as tiendas locales que desean tener una presencia en l\xednea y ofrecer a sus clientes una experiencia de compra conveniente.","https://raw.githubusercontent.com/reitmas32/yonesto_ui/main/assets/ui_store.png",A.nS(2023,8,27),A.a(["design","dev","flutter"],t.s),q,q,"https://yonesto-experiment.onrender.com/home","https://github.com/reitmas32/yonesto_ui")})
